    false,nt"url": null,nt"notes": "This annual narrative report for Arrowwood
    NWR (including Chase Lake NWR and the easement refuges)  outlines Refuge accomplishments
    during the 1965 calendar year. The report begins by summarizing the weather conditions,
    habitat conditions, water conditions, and food and cover conditions during the year.
    Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
    predators, rodents, mammals, raptors, and fish- is also covered. The Refuge development
    and maintenance section discusses physical developments, plantings, collections
    and receipts, vegetation control, and wildfires. Resource management is outlined;
    topics include grazing and fur harvesting. A progress report on field investigations
    and applied research is also provided. The public relations section of the report
    describes recreational uses, Refuge participation, hunting, fishing, violations,
    and safety. Items of interest, N-R forms, and photographs are attached.",nt"owner_org":
